import React, { useState} from 'react';
import s from './Counter.module.css'
import {ButtonComponent} from "./Button";
import {SetCounter} from "./SetCounter";




export const Counter = () => {

    const [counter,SetCounter]=useState(0)




      const onclickInc = () => {

          SetCounter(counter+1)

     }

     const  Reset =()=> {
        SetCounter(0)
     }

     const [set,Setset]=useState(false)


    const Set =()=> {
        Setset(!set)
        console.log(set)
    }



    const valueClassName = `${s.score} ${counter > 4 ? s.error : ''}`;
    return (
        <div className={s.fon}>

                <div className={s.around_wrapper}>
                    <input  className={valueClassName} value={counter}/>
                    <div className={s.around}>

                        <div className={s.button} >


                        <ButtonComponent name={'inc'} started={onclickInc} disabled={counter>4}/>
                        <ButtonComponent name={'reset'} started={Reset}/>
                            <ButtonComponent name={'set'} started={Set}/>
                            {set && <SetCounter />}


                        </div>
                    </div>



            </div>


        </div>
    );
};
